is_package: true
container:
  type: HtmlTemplate
  properties: {html: '@theme:standard-page.html'}
components:
- type: ColumnPanel
  properties: {col_widths: '{}'}
  name: content_panel
  layout_properties: {slot: default}
  components: []
- type: FlowPanel
  properties: {}
  name: navbar_links
  layout_properties: {slot: nav-right}
  components:
  - name: link_1
    properties: {text: Manage Users, icon: 'fa:backward', col_widths: '{}'}
    type: Link
    layout_properties: {grid_position: 'AKRBFP,SGFVBQ'}
    event_bindings: {click: link_1_click}
    components: []
- type: ColumnPanel
  properties: {}
  name: content_panel_copy
  layout_properties: {slot: default}
  components:
  - name: spacer_1
    properties: {height: 0}
    type: Spacer
    layout_properties: {grid_position: 'XDRSUE,OAIFBA'}
  - name: card_1
    properties: {role: card}
    type: ColumnPanel
    layout_properties: {grid_position: 'IERYVH,CSBJZS'}
    components:
    - name: image_1
      properties: {role: null, vertical_align: center, alt_text: '', spacing_above: small, background: '', horizontal_align: center, source: 'data:image/png;base64,', foreground: '', display_mode: shrink_to_fit, spacing_below: small, visible: true, border: '', tooltip: '', height: '180'}
      type: Image
      layout_properties: {grid_position: 'ZBNXLV,NWRZTT'}
    - name: image_2
      properties: {role: null, vertical_align: center, alt_text: '', spacing_above: small, background: '', horizontal_align: center, source: 'data:image/png;base64,', foreground: '', display_mode: shrink_to_fit, spacing_below: small, visible: true, border: '', tooltip: '', height: '180'}
      type: Image
      layout_properties: {grid_position: 'ZBNXLV,PXWCFM'}
    - name: add_employee_button
      properties: {text: Add Employee, role: primary-color}
      type: Button
      layout_properties: {grid_position: 'FHPWWF,YKHIHL'}
      event_bindings: {click: add_employee_button_click}
    - name: edit_employee_button
      properties: {text: Edit Employee, role: primary-color}
      type: Button
      layout_properties: {grid_position: 'FHPWWF,JCRECJ'}
- name: headline_1
  properties: {role: headline, text: Manage Employee}
  type: Label
  layout_properties: {slot: title, grid_position: 'AZRSKZ,NWJCLW'}
